Let Pugsley have $p$ spiders and Wednesday have $w$ spiders before the trade. Then we have the following system of equations:
\begin{align*}
w+4 &= 4(p-4) \\
p+5 &= w-5
\end{align*}
Simplifying the first equation gives $w=16-4p$. Substituting this into the second equation gives $p+5=16-4p-5$, which simplifies to $5p=16-10$, or $p=1$. Therefore, Pugsley has $\boxed{\textbf{(A) }6}$ spiders before the trade.

The radius of the inscribed circle is equal to the distance from the center of the quarter circle to the point where the two tangent lines to the inscribed circle intersect. This point is the midpoint of the arc opposite the diameter of the inscribed circle. 

[asy]
size(100);
draw(arc((0,0),20,0,90));
draw((0,0)--(20,0)--(20,20)--cycle);
draw((0,0)--(20,20));
draw((10,10)--(20,10));
draw((10,10)--(10,20));
label("$r$",(10,15),E);
label("$20$",(10,0),S);
[/asy]

Using the Pythagorean theorem, we have $r^2 + r^2 = (20-r)^2$, which simplifies to $2r^2 + 40r - 400 = 0$. Factoring out $2$, we get $2(r+10)(r-20) = 0$, so $r=\boxed{20(\sqrt{2}-1)}$.
